import{_ as a,c as e,o as t,U as o}from"./chunks/framework.K-r7inPk.js";const B=JSON.parse('{"title":"web端-表格勾选项导出","description":"","frontmatter":{"title":"web端-表格勾选项导出","date":"2020-07-01T16:41:49.000Z"},"headers":[],"relativePath":"doc/wpdoc/web端-表格勾选项导出.md","filePath":"doc/wpdoc/web端-表格勾选项导出.md"}'),E={name:"doc/wpdoc/web端-表格勾选项导出.md"},c=o('<p>版本要求：web包（V9.0+）+ 导入导出服务版本（v2.6.1）</p><p>**简述：**web端支持导出事件配置目标入參，flycode接口获取web上传的勾选参数做业务逻辑相关导出操作，web端提供捕捉页面数据作为导出接口的额外参数传入，具体业务逻辑需要flycode接口处理。</p><h3 id="前提-ide建立导出类型flycode接口" tabindex="-1">前提：IDE建立导出类型flycode接口 <a class="header-anchor" href="#前提-ide建立导出类型flycode接口" aria-label="Permalink to &quot;前提：IDE建立导出类型flycode接口&quot;">​</a></h3><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E8%A1%A8%E6%A0%BC%E5%8B%BE%E9%80%89%E6%95%B0%E6%8D%AE%E5%AF%BC%E5%87%BA-1.png" alt=""></p><h3 id="一、-无入參导出" tabindex="-1">一、 无入參导出 <a class="header-anchor" href="#一、-无入參导出" aria-label="Permalink to &quot;一、 无入參导出&quot;">​</a></h3><h4 id="场景-全量数据导出" tabindex="-1">场景：全量数据导出 <a class="header-anchor" href="#场景-全量数据导出" aria-label="Permalink to &quot;场景：全量数据导出&quot;">​</a></h4><h5 id="_1、ide-导出接口flycode协议结构" tabindex="-1">1、IDE - 导出接口flycode协议结构： <a class="header-anchor" href="#_1、ide-导出接口flycode协议结构" aria-label="Permalink to &quot;1、IDE - 导出接口flycode协议结构：&quot;">​</a></h5><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E8%A1%A8%E6%A0%BC%E5%8B%BE%E9%80%89%E6%95%B0%E6%8D%AE%E5%AF%BC%E5%87%BA-2.png" alt=""></p><h5 id="_2、web端导出接口上传参数结构" tabindex="-1">2、web端导出接口上传参数结构： <a class="header-anchor" href="#_2、web端导出接口上传参数结构" aria-label="Permalink to &quot;2、web端导出接口上传参数结构：&quot;">​</a></h5><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E8%A1%A8%E6%A0%BC%E5%8B%BE%E9%80%89%E6%95%B0%E6%8D%AE%E5%AF%BC%E5%87%BA-3.png" alt=""></p><h3 id="二、-有入參-其中入參为对象的导出" tabindex="-1">二、 有入參，其中入參为对象的导出 <a class="header-anchor" href="#二、-有入參-其中入參为对象的导出" aria-label="Permalink to &quot;二、 有入參，其中入參为对象的导出&quot;">​</a></h3><h4 id="场景-依据搜索条件-导出查询结果数据" tabindex="-1">场景：依据搜索条件，导出查询结果数据 <a class="header-anchor" href="#场景-依据搜索条件-导出查询结果数据" aria-label="Permalink to &quot;场景：依据搜索条件，导出查询结果数据&quot;">​</a></h4><h5 id="_1、导出接口flycode协议结构" tabindex="-1">1、导出接口flycode协议结构： <a class="header-anchor" href="#_1、导出接口flycode协议结构" aria-label="Permalink to &quot;1、导出接口flycode协议结构：&quot;">​</a></h5><p>有附加入參，对象结构，入參字段绑定搜索条件控件</p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E8%A1%A8%E6%A0%BC%E5%8B%BE%E9%80%89%E6%95%B0%E6%8D%AE%E5%AF%BC%E5%87%BA-4.png" alt=""></p><h5 id="_2、web端导出接口上传参数结构-1" tabindex="-1">2、web端导出接口上传参数结构： <a class="header-anchor" href="#_2、web端导出接口上传参数结构-1" aria-label="Permalink to &quot;2、web端导出接口上传参数结构：&quot;">​</a></h5><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E8%A1%A8%E6%A0%BC%E5%8B%BE%E9%80%89%E6%95%B0%E6%8D%AE%E5%AF%BC%E5%87%BA-5.png" alt=""></p><h3 id="二、-有入參-其中入參为数组的导出" tabindex="-1">二、 有入參，其中入參为数组的导出 <a class="header-anchor" href="#二、-有入參-其中入參为数组的导出" aria-label="Permalink to &quot;二、 有入參，其中入參为数组的导出&quot;">​</a></h3><h4 id="场景-导出列表勾选数据" tabindex="-1">场景：导出列表勾选数据 <a class="header-anchor" href="#场景-导出列表勾选数据" aria-label="Permalink to &quot;场景：导出列表勾选数据&quot;">​</a></h4><h5 id="_1、导出接口flycode协议结构-1" tabindex="-1">1、导出接口flycode协议结构： <a class="header-anchor" href="#_1、导出接口flycode协议结构-1" aria-label="Permalink to &quot;1、导出接口flycode协议结构：&quot;">​</a></h5><p>导出事件入參只支持对象结构入参，导出勾选数据的方案是，将目标勾选数组转为字符串，存储某个入參字段作为接口数据提交，flycode进行数据处理。</p><p>Demo场景如下：</p><p>导出接口入參：</p><p>1、对象类型，tn_ids字段存储勾选数据值</p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E8%A1%A8%E6%A0%BC%E5%8B%BE%E9%80%89%E6%95%B0%E6%8D%AE%E5%AF%BC%E5%87%BA-6.png" alt=""><br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E8%A1%A8%E6%A0%BC%E5%8B%BE%E9%80%89%E6%95%B0%E6%8D%AE%E5%AF%BC%E5%87%BA-7.png" alt=""></p><p>2、配置数据序列化事件将目标勾选数据结构[{tn_id:xxx}]转为字符类型存储在tn_id（也可以通过UIflycode转）</p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E8%A1%A8%E6%A0%BC%E5%8B%BE%E9%80%89%E6%95%B0%E6%8D%AE%E5%AF%BC%E5%87%BA-8.png" alt=""><br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E8%A1%A8%E6%A0%BC%E5%8B%BE%E9%80%89%E6%95%B0%E6%8D%AE%E5%AF%BC%E5%87%BA-10.png" alt=""></p><p>3、数据序列化字段</p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E8%A1%A8%E6%A0%BC%E5%8B%BE%E9%80%89%E6%95%B0%E6%8D%AE%E5%AF%BC%E5%87%BA-11.png" alt=""></p><p>4、web端导出接口上传参数结构</p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E8%A1%A8%E6%A0%BC%E5%8B%BE%E9%80%89%E6%95%B0%E6%8D%AE%E5%AF%BC%E5%87%BA-12.png" alt=""></p><p>效果图</p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E8%A1%A8%E6%A0%BC%E5%8B%BE%E9%80%89%E6%95%B0%E6%8D%AE%E5%AF%BC%E5%87%BA-13.png" alt=""><br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E8%A1%A8%E6%A0%BC%E5%8B%BE%E9%80%89%E6%95%B0%E6%8D%AE%E5%AF%BC%E5%87%BA-14.png" alt=""></p>',33),p=[c];function n(l,d,i,r,h,s){return t(),e("div",null,p)}const _=a(E,[["render",n]]);export{B as __pageData,_ as default};
